{
  "translationLines": [
    {
      "lineNumber": 20591,
      "originalJapaneseLine": "「ようし！　ひねり潰して進むぞ！",
      "translatedEnglishLine": "\"Alright! Let's crush them and move forward!\""
    },
    {
      "lineNumber": 20592,
      "originalJapaneseLine": "　略奪は程々にな。ただし皆殺しにしろ！」",
      "translatedEnglishLine": "Keep the looting moderate. But kill them all!\""
    },
    {
      "lineNumber": 20593,
      "originalJapaneseLine": "「へへっ、へい！」",
      "translatedEnglishLine": "\"Hehe, yes sir!\""
    },
    {
      "lineNumber": 20594,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": "\"............\""
    },
    {
      "lineNumber": 20595,
      "originalJapaneseLine": "「そっちのお前も分かったな！",
      "translatedEnglishLine": "\"You over there, got that too!\""
    },
    {
      "lineNumber": 20596,
      "originalJapaneseLine": "　……おい、どうした？」",
      "translatedEnglishLine": "\"...Hey, what's wrong?\""
    },
    {
      "lineNumber": 20597,
      "originalJapaneseLine": "先頭を行く魔物兵の様子がおかしかった。",
      "translatedEnglishLine": "The monster soldier at the front looked strange."
    },
    {
      "lineNumber": 20598,
      "originalJapaneseLine": "足は止めないものの鈍くなり、",
      "translatedEnglishLine": "Though not stopping their feet, their pace slowed,"
    },
    {
      "lineNumber": 20599,
      "originalJapaneseLine": "衰弱しているようでもあった。",
      "translatedEnglishLine": "It seemed as if they were weakening."
    },
    {
      "lineNumber": 20600,
      "originalJapaneseLine": "「おっ、おい……！？",
      "translatedEnglishLine": "\"H-Hey...!?\""
    },
    {
      "lineNumber": 20601,
      "originalJapaneseLine": "「なんか、っ……気分が、悪く……っ……！」",
      "translatedEnglishLine": "\"I feel... sick...!\""
    },
    {
      "lineNumber": 20602,
      "originalJapaneseLine": "先頭の魔物兵だけではなかった。",
      "translatedEnglishLine": "It wasn't just the monster soldier at the front."
    },
    {
      "lineNumber": 20603,
      "originalJapaneseLine": "魔物兵たちは次々と体調の悪化を訴え、",
      "translatedEnglishLine": "Monster soldiers one after another complained of worsening condition,"
    },
    {
      "lineNumber": 20604,
      "originalJapaneseLine": "突撃の速度が鈍る。",
      "translatedEnglishLine": "Slowing the speed of their charge."
    },
    {
      "lineNumber": 20605,
      "originalJapaneseLine": "「う、うぶっ……なんだっ……？",
      "translatedEnglishLine": "\"Ugh, ugh... What is this...?\""
    },
    {
      "lineNumber": 20606,
      "originalJapaneseLine": "　どこからだ……！」",
      "translatedEnglishLine": "\"Where is it coming from...!?\""
    },
    {
      "lineNumber": 20607,
      "originalJapaneseLine": "「アレだ！　あの村だ！」",
      "translatedEnglishLine": "\"That! That village!\""
    },
    {
      "lineNumber": 20608,
      "originalJapaneseLine": "「うっ、だ、ダメだっ……！",
      "translatedEnglishLine": "\"Ugh, no, this is bad...!\""
    },
    {
      "lineNumber": 20609,
      "originalJapaneseLine": "　さ、避けて、行くしか…………！」",
      "translatedEnglishLine": "\"W-we have no choice but to avoid it and go around...!\""
    },
    {
      "lineNumber": 20610,
      "originalJapaneseLine": "魔軍の兵たちで出来た津波が、真っ二つに割れた。",
      "translatedEnglishLine": "The tsunami made of demon army soldiers split in two."
    },
    {
      "lineNumber": 20611,
      "originalJapaneseLine": "「？　？？？",
      "translatedEnglishLine": "\"? What the...?"
    },
    {
      "lineNumber": 20612,
      "originalJapaneseLine": "　何よこれ！？　なんなのよーーーー！」",
      "translatedEnglishLine": "\"What is this!? What the hell is this!\""
    },
    {
      "lineNumber": 20613,
      "originalJapaneseLine": "「げばっ！」",
      "translatedEnglishLine": "\"Geh!\""
    },
    {
      "lineNumber": 20614,
      "originalJapaneseLine": "脇を通り抜ける魔物兵の一人が、",
      "translatedEnglishLine": "One monster soldier passing by the side"
    },
    {
      "lineNumber": 20615,
      "originalJapaneseLine": "力尽きて地面に転がった。",
      "translatedEnglishLine": "Collapsed to the ground, exhausted."
    },
    {
      "lineNumber": 20616,
      "originalJapaneseLine": "「お、おおぉぉ……！",
      "translatedEnglishLine": "\"O-ohhh...!"
    },
    {
      "lineNumber": 20617,
      "originalJapaneseLine": "　なんという…………！」",
      "translatedEnglishLine": "\"What is this...!\""
    },
    {
      "lineNumber": 20618,
      "originalJapaneseLine": "「なんてブスだ！",
      "translatedEnglishLine": "\"What an ugly woman!"
    },
    {
      "lineNumber": 20619,
      "originalJapaneseLine": "　こんなブスがこんな片田舎にいるとは……ぐぶっ」",
      "translatedEnglishLine": "\"I can't believe such an ugly woman is in this godforsaken countryside... uggh.\""
    },
    {
      "lineNumber": 20620,
      "originalJapaneseLine": "「なんですってぇ、　もういっぺん言ってみなさい！",
      "translatedEnglishLine": "\"What did you say? Say that again!\""
    },
    {
      "lineNumber": 20621,
      "originalJapaneseLine": "　こらーーーーー！」",
      "translatedEnglishLine": "\"Heyyyyy!\""
    },
    {
      "lineNumber": 20622,
      "originalJapaneseLine": "「わ、わあああああ！",
      "translatedEnglishLine": "\"W-waaahhh!\""
    },
    {
      "lineNumber": 20623,
      "originalJapaneseLine": "　ブスが追いかけてきた！」",
      "translatedEnglishLine": "\"The ugly woman is chasing after us!\""
    },
    {
      "lineNumber": 20624,
      "originalJapaneseLine": "シルバレルは怒りながら、",
      "translatedEnglishLine": "Silverel, angry,"
    },
    {
      "lineNumber": 20625,
      "originalJapaneseLine": "逃げ惑う魔軍を追いかけて走り始めた。",
      "translatedEnglishLine": "Began running after the fleeing demon army."
    },
    {
      "lineNumber": 20626,
      "originalJapaneseLine": "………………",
      "translatedEnglishLine": "............"
    },
    {
      "lineNumber": 20627,
      "originalJapaneseLine": "…………",
      "translatedEnglishLine": "........"
    },
    {
      "lineNumber": 20628,
      "originalJapaneseLine": "……",
      "translatedEnglishLine": "..."
    },
    {
      "lineNumber": 20629,
      "originalJapaneseLine": "村に、静けさが戻ってきた。",
      "translatedEnglishLine": "Quiet returned to the village."
    },
    {
      "lineNumber": 20630,
      "originalJapaneseLine": "「い、行っちゃった……",
      "translatedEnglishLine": "\"T-they've gone...\""
    },
    {
      "lineNumber": 20631,
      "originalJapaneseLine": "　僕たち……助かった、の……？」",
      "translatedEnglishLine": "\"Did... we... survive...?\""
    },
    {
      "lineNumber": 20632,
      "originalJapaneseLine": "「お…………おおぉぉおお……",
      "translatedEnglishLine": "\"Oh... ohhhh...\""
    },
    {
      "lineNumber": 20633,
      "originalJapaneseLine": "　き、奇跡、じゃ……」",
      "translatedEnglishLine": "\"It's... a miracle...\""
    },
    {
      "lineNumber": 20634,
      "originalJapaneseLine": "「本当だわ……！",
      "translatedEnglishLine": "\"It's true...!\""
    },
    {
      "lineNumber": 20635,
      "originalJapaneseLine": "　こんな事が起こるなんてねぇ……",
      "translatedEnglishLine": "\"I can't believe something like this happened...\""
    },
    {
      "lineNumber": 20636,
      "originalJapaneseLine": "　ありがたや……」",
      "translatedEnglishLine": "\"How thankful...\""
    },
    {
      "lineNumber": 20637,
      "originalJapaneseLine": "「でも……行っちゃったね、あの人……」",
      "translatedEnglishLine": "\"But... that person has gone...\""
    },
    {
      "lineNumber": 20638,
      "originalJapaneseLine": "「……うむ！",
      "translatedEnglishLine": "\"...Indeed!\""
    },
    {
      "lineNumber": 20639,
      "originalJapaneseLine": "　あのブサイクなお方の姿を、像にして残そう！",
      "translatedEnglishLine": "\"Let's immortalize the figure of that ugly person as a statue!\""
    },
    {
      "lineNumber": 20640,
      "originalJapaneseLine": "　きっと村を守ってくれる！」",
      "translatedEnglishLine": "\"Surely, it will protect our village!\""
    }
  ]
}

